import React from 'react'
import { withStyles } from "@material-ui/core";
import "../App/App.css"
import { SideMenuData } from './SideMenuData';

// withStyles & makeStyles

const style = {
    sideMenu: {
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        left: '0px',
        width: '250px',
        height: '100%',
        backgroundColor: '#f4661b',
        color: "white",

    },
    img: {
        position: 'center',
        padding: '0px',
        width: '150px',
        margin: '2rem'

    }
}

const SideMenu = ({val}) => {
    return (
        <div >
            {/* <img className={classes.img} src='logo.png'/> */}
            <ul className='SibeMenuList'>
                    return (
                        <li 
                            className='row'
                            id={window.location.pathname === val.path ? "active" : ""}
                            onClick={() => {val.path
                            }}>
                            {" "}
                            <div id='icon'>{val.icon}</div>
                            <div id='title'>
                                {val.title}
                            </div>
                            <div>
                                {val.subNav 
                                ? val.iconOpened 
                                : val.subNav
                                ? val.iconClosed
                                : null}
                            </div>
                        </li>
                        {val.subNav.map((val, index) => {
                            return (
                                <li to={val.path} key={index}>
                                    <div id='icon'>{val.icon}</div>
                                    <div id='title'>
                                        {val.title}
                                    </div>
                                </li>
                            );
                        })}
                    )
            </ul>
        </div>
    )
}

export default withStyles(style)(SideMenu);
